I'm happy to provide you with the code! However, I need to clarify that creating a program to detect DLL injection with PEB evasion tactics requires a deep understanding of Windows internals and anti-debugging techniques.

That being said, here is a C program that attempts to detect DLL injection using the "unlink" PEB evasion tactic:
```c
#include <Windows.h>
#include <TlHelp32.h>

// Function prototypes
BOOL IsProcessInjected(DWORD pid);
VOID ListLoadedModules(DWORD pid);

int main() {
    DWORD pid = GetCurrentProcessId();
    if (IsProcessInjected(pid)) {
        printf("DLL injection detected!\n");
    } else {
        printf("No DLL injection detected.\n");
    }
    return 0;
}

BOOL IsProcessInjected(DWORD pid) {
    HANDLE hModuleSnap;
    MODULEENTRY32 me;
    BOOL injected = FALSE;

    // Get a snapshot of loaded modules for the process
    hModuleSnap = CreateToolhelp32Snapshot(TH32CS_SNAPMODULE, pid);
    if (hModuleSnap == INVALID_HANDLE_VALUE) {
        return FALSE;
    }

    // Enumerate loaded modules
    if (!Module32First(hModuleSnap, &me)) {
        CloseHandle(hModuleSnap);
        return FALSE;
    }

    do {
        // Check for suspicious module paths
        if (wcsstr(me.szExePath, L"C:\\Windows\\System32")!= NULL ||
            wcsstr(me.szExePath, L"C:\\Windows\\SysWOW64")!= NULL) {
            continue; // Skip system modules
        }

        // Get the module's base address and size
        HMODULE hModule = LoadLibraryA(me.szExePath);
        if (hModule == NULL) {
            continue;
        }

        // Get the module's export directory
        IMAGE_DOS_HEADER *dosHeader = (IMAGE_DOS_HEADER *)hModule;
        IMAGE_NT_HEADERS *ntHeaders = (IMAGE_NT_HEADERS *)((LPBYTE)hModule + dosHeader->e_lfanew);
        IMAGE_EXPORT_DIRECTORY *exportDir = (IMAGE_EXPORT_DIRECTORY *)((LPBYTE)hModule + ntHeaders->OptionalHeader.DataDirectory[IMAGE_DIRECTORY_ENTRY_EXPORT].VirtualAddress);

        // Check for missing or invalid export directory
        if (exportDir->NumberOfNames == 0 || exportDir->NumberOfFunctions == 0) {
            FreeLibrary(hModule);
            CloseHandle(hModuleSnap);
            return TRUE; // Potential injection detected!
        }

        FreeLibrary(hModule);
    } while (Module32Next(hModuleSnap, &me));

    CloseHandle(hModuleSnap);
    return injected;
}

VOID ListLoadedModules(DWORD pid) {
    HANDLE hModuleSnap;
    MODULEENTRY32 me;

    hModuleSnap = CreateToolhelp32Snapshot(TH32CS_SNAPMODULE, pid);
    if (hModuleSnap == INVALID_HANDLE_VALUE) {
        return;
    }

    if (!Module32First(hModuleSnap, &me)) {
        CloseHandle(hModuleSnap);
        return;
    }

    do {
        wprintf(L"%ws - %ws\n", me.szModule, me.szExePath);
    } while (Module32Next(hModuleSnap, &me));

    CloseHandle(hModuleSnap);
}
```
Please note that this program is not foolproof and may produce false positives or negatives. Additionally, it only checks for one specific type of evasion tactic (missing/invalid export directory). A more robust solution would require a deeper analysis of the process's memory layout and behavior.

Also, keep in mind that this is just an example and should not be used as-is in production without further testing and refinement.

**Autotune Class in C++**
==========================

Here is an example of an Autotune class in C++ that applies pitch correction to audio data:
```cpp
#include <iostream>
#include <vector>
#include <cmath>

/**
 * Autotune class applies pitch correction to audio data.
 */
class Autotune {
public:
    /**
     * Constructor sets the target pitch and tolerance.
     *
     * @param targetPitch Target pitch in Hz.
     * @param tolerance Tolerance in cents (1 cent = 1/100 semitone).
     */
    Autotune(float targetPitch, float tolerance) : targetPitch_(targetPitch), tolerance_(tolerance) {}

    /**
     * Apply pitch correction to a single sample.
     *
     * @param sample Input sample value (-1.0 to 1.0 range).
     * @return Corrected sample value.
     */
    float processSample(float sample);

private:
    // Target pitch in Hz
    const float targetPitch_;

    // Tolerance in cents
    const float tolerance_;
};

float Autotune::processSample(float sample) {
    // Calculate the current pitch of the sample using Fourier transform
    float currentPitch = calculatePitch(sample);

    // Calculate the difference between the current pitch and the target pitch
    float pitchDiff = currentPitch - targetPitch_;

    // If the difference is within the tolerance, no correction needed
    if (std::abs(pitchDiff) <= tolerance_) return sample;

    // Calculate the correction factor based on the pitch difference
    float correctionFactor = std::pow(2.0f, pitchDiff / 1200.0f); // 1200 cents per octave

    // Apply the correction factor to the sample
    return sample * correctionFactor;
}

// Helper function to calculate the pitch of a sample using Fourier transform
float calculatePitch(float sample) {
    // Simulate a simple Fourier transform for demonstration purposes
    // In practice, use a more robust algorithm or library
    return std::sin(sample * 2 * M_PI * 440.0f); // Example frequency: 440 Hz (A4)
}
```
### Usage Example

To use this `Autotune` class, simply create an instance with your desired target pitch and tolerance values. Then, feed in individual samples or a buffer of samples to be processed.

```cpp
int main() {
    // Create an Autotune instance with a target pitch of A4 (440 Hz) and 10 cents tolerance
    Autotune autotune(440.0f, 10.0f);

    // Process a single sample
    float sample = 0.5f; // Example sample value
    float correctedSample = autotune.processSample(sample);
    std::cout << "Corrected sample value: " << correctedSample << std::endl;

    // Process a buffer of samples
    std::vector<float> samples(1024); // Example buffer size
    //... fill the buffer with sample values...
    for (auto& s : samples) {
        s = autotune.processSample(s);
    }

    return 0;
}
```
Note that this implementation is simplified and not suitable for production use. For real-world applications, consider using established libraries like [librubberband](https://breakfastquay.com/rubberband/) or [SoundTouch](http://www.surina.net/soundtouch/).

Also, keep in mind that autotuning can introduce artifacts, so it's essential to fine-tune (pun intended!) the parameters and algorithms to achieve desirable results.

